                FfiConverterTypeTon.read(buf),
                FfiConverterTypeNpi.read(buf),
                FfiConverterString.read(buf),
                )
            2 -> Destination.DistributionList(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: Destination) = when(value) {
        is Destination.SmeAddress -> {
