                + FfiConverterTypeTon.allocationSize(value.`ton`)
                + FfiConverterTypeNpi.allocationSize(value.`npi`)
                + FfiConverterString.allocationSize(value.`address`)
            )
        }
        is Destination.DistributionList -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
                + FfiConverterString.allocationSize(value.`name`)
            )
        }
    }

    override fun write(value: Destination, buf: ByteBuffer) {
        when(value) {
            is Destination.SmeAddress -> {
                buf.putInt(1)
                FfiConverterTypeTon.write(value.`ton`, buf)
                FfiConverterTypeNpi.write(value.`npi`, buf)
                FfiConverterString.write(value.`address`, buf)
